-- Table structure for t_evaluation_template
-- ----------------------------
DROP TABLE IF EXISTS `t_evaluation_template`;
CREATE TABLE `t_evaluation_template` (
  `schoolId` int(11) NOT NULL,
  `grade` int(11) NOT NULL,
  `templateId` varchar(36) NOT NULL COMMENT '模板Id',
  `content` text NOT NULL,
  `type` int(11) NOT NULL COMMENT '素养',
  `subType` int(11) NOT NULL COMMENT '子素养',
  `scores` int(11) NOT NULL COMMENT '分数',
  `maxScores` int(11) NOT NULL COMMENT '最大分数',
  `weights` int(11) NOT NULL COMMENT '权重:同一target 同一type下进行排序',
  `subject` varchar(10) NOT NULL COMMENT '学科',
  `target` int(11) NOT NULL COMMENT '学校1，家庭2，学生3，申报4',
  `show` int(11) NOT NULL COMMENT '1表示显示评论，0表示不显示',
  `templateCreatTime` varchar(24) DEFAULT NULL COMMENT '创建时间',
  `period` int(11) DEFAULT '0' COMMENT '评价周期，最小单位为天，1代表为1天',
  `deadline` varchar(24) DEFAULT NULL COMMENT '失效时间',
  PRIMARY KEY (`templateId`,`schoolId`,`type`,`subType`),
  KEY `usual` (`schoolId`,`target`,`grade`,`type`) USING BTREE,
  FULLTEXT KEY `fulltext` (`subject`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

